INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256224397892', 'Salade pâtes jambon emmental et crudités', 'Salade composée 90.3% : pâte alimentaire mini-conchiglie aromatisée au curcuma cuite 33% (eau, semoule de BLE dur, curcuma déshydraté 0.02%), salade mélangée verte et rouge 22% (laitue et chicorée), jambon cuit supérieur 12% [jambon de porc (France) 11%, eau, sel, dextrose, gélatine de porc, bouillon de légumes (blette, acérola, carotte), ferments], tomate cerise 7%, EMMENTAL 6%, fève de SOJA 2%, carotte 2%, ciboulette*, huile de colza, sel. Vinaigrette 9.7% : huile de colza, vinaigre, moutarde (eau, graines de MOUTARDE, vinaigre, sel), sel, poivre.* Produit décongelé, ne pas recongeler. Traces éventuelles d oeufs.', 'https://static.openfoodfacts.org/images/products/325/622/439/7892/front_fr.34.400.jpg', '3.9', '1.6', '11.2', '2.6', '2', '7.6', '0.54', '0.21259842519685', '', '1');

