VALUES ('3256224557692', 'Cookies caramel pépites de chocolat au lait', 'Farine de BLE (France) 37,8%, pépites de chocolat au lait 20% (sucre, LAIT en poudre, beurre de cacao, pâte de cacao, LACTOSE, émulsifiant : lécithines de SOJA, arôme naturel de vanille), sucre, huile de palme, BEURRE, éclats de caramel au beurre salé 5% (sucre, sirop de glucose, CREME fraîche, BEURRE salé, LAIT écrémé en poudre, sel marin), billettes de céréales (riz, AVOINE, farine de BLÉ, SEIGLE, semoule de maïs, LACTOSÉRUM, sirop de malt d\'ORGE, sel marin), poudres à lever : carbonates d\'ammonium - carbonates de sodium, sel marin, arôme, OEUFS en poudre, poudre de LAIT écrémé. Traces éventuelles de fruits à coque, de graines de sésame et d\'arachides.', 'https://static.openfoodfacts.org/images/products/325/622/455/7692/front_fr.36.400.jpg', '26.2', '15.7', '62.6', '31.9', '1.6', '5.7', '0.47', '0.18503937007874', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256224559153', 'Petit déjeuner tartiné goût chocolat noisette', 'Céréales 58.6%* [farine de BLE 32.4%*, céréales complètes 26.2%* (farine complète de BLE 10.6%*, flocons d\'AVOINE 10.4%*, farine complète d\'ORGE 3%*, farine complète d\'\'EPEAUTRE 1.1%*, farine complète de SEIGLE 1.1%*], sucre, huiles de tournesol et de colza, cacao maigre en poudre 2.2%*, BEURRE, poudres à lever : carbonates de sodium - carbonates d\'ammonium - diphosphates , amidon de BLE, LAIT écrémé en poudre, pâte de praliné 0.6%* (NOISETTE, sucre), arômes, émulsifiants : E472e, lécithines de colza (BLE), sel, LACTOSERUM en poudre.*% exprimé sur l\'ensemble du produit. Traces éventuelles d\'oeufs et de soja', 'https://static.openfoodfacts.org/images/products/325/622/455/9153/front_fr.23.400.jpg', '17.5', '3.5', '67.1', '27.4', '4.8', '7', '0.69', '0.271653543307087', '', '0');

