VALUES ('3256225042166', 'Saucisses purée et sauce moutarde à l\'ancienne', 'Saucisse cuite 30% [viande de porc (Union Européenne) 27%, glace, sel, épices et aromates (dont MOUTARDE), conservateur : nitrite de sodium. Boyau de porc], pomme de terre 26%, eau, CREME réhydratée, flocon de pomme de terre déshydraté 3,1% (pomme de terre 3%, curcuma), BEURRE, moutarde à l\'ancienne 1,5% (eau, graines de MOUTARDE (Canada, France), vinaigre d\'alcool, sel), moutarde de Dijon 0,8% [eau, graines de MOUTARDE (Canada, France), vinaigre d\'alcool, sel], échalote, vinaigre d\'alcool, jus de veau lié aromatisé déshydraté (fécule de pomme de terre, sel, arômes naturels, sucre, graisse de poulet, oignon, chicorée, viande de veau deshydratée, tomate deshydratée, ail), roux (farine de BLE, BEURRE), sel, vin blanc réduit, ail,  curcuma, noix de muscade, poivre, épaississant : gomme xanthane. Soit 60% de purée de pomme de terre et 10% de sauce à la moutarde dans le produit. Certains ingrédients de ce produit ne proviennent pas de France. Traces éventuelles d\'arachides, crustacés, céleri, fruits à coque, graines de sésame, mollusques, oeufs, poissons et soja.', 'https://static.openfoodfacts.org/images/products/325/622/504/2166/front_fr.16.400.jpg', '12', '5.6', '11', '1.1', '1.3', '6.4', '1', '0.393700787401575', '', '1');

