VALUES ('3256225042371', 'Pack mini paquets de céréales', 'Boules miel : Céréales [semoule de maïs (France) 43%, farine de blé (France) 39%],sucre, miel 5%, sel, antiagglomérant : carbonate de calcium, arôme naturel, colorants : béta carotène et rocou, caramel (sucre, eau), sirop de sucre caramélisé, vitamines : niacine (PP) -acide pantothénique (B5) - riboflavine (B2) - thiamine (B1) - B6 - B12 - acide folique (B9) -biotine (B8), fer. Fourrées au lait : Céréales 50% [semoule de riz, farine de blé (France) 16%, farined\'avoine, farine complète de blé (France) 2%], fourrage au lait 40% [lait entier en poudre13%, sucre, graisses de tournesol et de coprah, lait écrémé en poudre 2%, lactosérum en poudre, émulsifiant : lécithine de tournesol], chocolat en poudre 4%(sucre, cacao en poudre), inuline (fibres solubles), sucre, cacao maigre en poudre, vitamines : niacine (PP) - E - B6 - riboflavine (B2) - thiamine (B1) - acide folique (B9) - B12, fer, sel, antioxydant : extrait riche en tocophérols, antiagglomérant : carbonate de calcium. Fourrées chocolat : Céréales 55% (semoule de riz, farine de blé (France) 17%, farine d\'avoine, farine complète de blé (France) 2,4%), fourrage chocolat 35% [sucre, graisses de tournesol et de coprah, lactosérum en poudre, chocolat 4,5% (sucre, cacao en poudre, beurre de cacao), noisettes 1%, émulsifiant : lécithines de tournesol, arôme], chocolat en poudre5% (sucre, cacao en poudre), inuline (fibres solubles), sucre, cacao maigre en poudre,vitamines : niacine (PP) - E - B6 - riboflavine (B2) - thiamine (B1) - acide folique (B9) - B12,fer, sel, antioxydant : extrait riche en tocophérols, antiagglomérant : carbonate de calcium. Pétales de blé chocolat : Céréales [farine de blé (France) 40%, farine de blé complet (France)25%, semoule de maïs (France) 3%], chocolat en poudre 22% (sucre, cacao en poudre),sucre, sirop de glucose, huile de tournesol, sel, arômes naturels, émulsifiant : esterscitriques des mono- et diglycérides d\'acides gras, vitamines : niacine (PP) - acidepantothénique (B5) - riboflavine (B2) - B6 - thiamine (B1) - acide folique (B9) - biotine (B8) -B12, fer.CFS : Maïs* (France), sucre*, extrait de malt d\'orge, sel, émulsifiant : mono- et diglycérides d\'acides gras, vitamines : niacine (PP) - acide pantothénique (B5) - B6 - riboflavine (B2) - thiamine (B1) - acide folique (B9) - biotine (B8) - B12, fer.* Fabriqué à partir de 76 g de maïs et 29 g de sucre pour obtenir 100 g de produit fini. Boules miel : Traces éventuelles d\'arachide, soja, lait, fruits à coque et sésame.  Fourrées au lait : Traces éventuelles d\'arachide, soja, fruits à coque et graines de sésame. Fourrées chocolat : Traces éventuelles d\'arachide, soja, autres fruits à coque et graines de sésame.  Pétales de blé chocolat : Traces éventuelles d\'arachide, soja, lait, fruits à coque et graines de sésame. CFS : Traces éventuelles d\'arachide, soja, lait, fruits à coque et graines de sésame.', 'https://static.openfoodfacts.org/images/products/325/622/504/2371/front_fr.17.400.jpg', '0.9', '0.1', '85', '25', '2.5', '6.7', '0.5', '0.196850393700787', '', '1');

