VALUES ('3256225042791', 'Assortiment glaces cool mix', '2 Tubes goût cola de 74 g : Eau, sucre, dextrose, acidifiant : acide citrique, extrait de malt d\'ORGE, stabilisants : gomme guar - alginate de sodium - carraghénanes, arôme naturel.2 Fusées de 60 g : Eau, sucre, jus de fruit à base de concentré 6,4% (framboise 2,5%*, orange 2%*, citron 1,9%*), sirop de glucose, stabilisants : gomme guar - farine de graines de caroube - pectine, acidifiant : acide citrique, colorants : extrait de paprika - rouge de betterave - caroténoïdes, arômes naturels,arôme naturel d\'orange.*Pourcentage exprimé sur la Fusée.2 Fantômes vanille de 33 g : LAIT écrémé réhydraté, CREME 20%*, eau, sucre, sirop de glucose, dextrose, émulsifiant : mono- et diglycérides d\'acides gras, arôme naturel de vanille, stabilisants : farine de graines de caroube - gomme guar.*Pourcentage exprimé sur le Fantôme vanille.2 Disco Lollies de 33 g : Eau, billes de sucre 24,2%* (sucre, amidon de BLE, sirop de glucose, concentrés végétaux de carthame, de citron, de radis, de cassis et d\'algue, agent d\'enrobage : cire d\'abeille), enrobage goût chocolat 15,1%* (huiles végétales de colza et de tournesol, sucre, beurre de cacao, poudre de cacao maigre, émulsifiant : lécithine de tournesol), LAIT écrémé reconstitué, sucre, sirop de glucose, protéines de LAIT, BEURRE, émulsifiant : mono- et diglycérides d\'acides gras, stabilisants : gomme guar - farine de graines de caroube, arôme naturel de vanille.*Pourcentage exprimé sur le Disco Lollie.2 Bâtonnets lait et fraise de 30 g : Eau, sucre, jus de fraises à base de concentré 10,3%*, LAIT écrémé reconstitué, sirop de glucose, protéines de LAIT, BEURRE, colorants : rouge de betterave - caroténoïdes, stabilisants : gomme guar - farine de graines de caroube - pectine, émulsifiant : mono- et diglycérides d\'acides gras, acidifiant : acide citrique, arôme naturel, arôme naturel de vanille.*Pourcentage exprimé sur le Bâtonnet lait et fraise.Traces éventuelles de fruits à coque, d\'oeufs, d\'arachides et de soja.', 'https://static.openfoodfacts.org/images/products/325/622/504/2791/front_fr.26.400.jpg', '0', '0', '22.3', '22.3', '0.5', '0', '0', '0', '', '0');

