VALUES ('3256225426249', 'Bûche glacée, coco-passion-fruits exotiques', 'Eau, sirop de glucose-fructose, sucre, jus concentré de fruits de la passion 9%, _crème_, _Iait_ écrémé réhydraté, mélange de fruits exotiques 5,5% (purée de mangue 3,4%, jus concentre de fruits de la passion 0,9%, jus concentré d‘ananas 0,6%, jus concentré de pêche 0,5%), préparation de morceaux de mangue 3% (morceaux de mangue 2,1%, sucre, sirop de glucose—fructose, eau, épaississant : gomme xanthane, arôme naturel, antioxydant : acide ascorbique, colorant : lutéine), _lactose_ et protéines de _lait_, lait de noix de coco en poudre 2,7% (lait de noix de coco en poudre, _caséinate_ de sodium), sirop de glucose, _lait_ écrémé concentré, pépites de sucre saveur fraise 0,6% (sucre, beurre de cacao, sirop de glucose, arôme naturel de fraise avec autres arômes naturels, jus concentré de sureau, correcteur d\'acidité : acide citrique), plaquette en chocolat noir 0,5% (pâte de cacao, sucre, beurre de cacao, arôme naturel de vanille, colorants : carbonate de calcium et oxyde de fer), arôme naturel de fruits exotiques, jus concentré de carotte, arôme naturel de fruits de la passion, émulsitiant : mono- et diglycérides d\'acides gras, gélifiants : farine de graines de caroube - gomme guar - gomme xanthane - pectines — gomme tara, morceaux de meringue enrobés de beurre de cacao 0,2% (meringue (sucre, blanc d\'_œuf_, amidon de _blé_), beurre de cacao, sucre),_arôme naturel de noix de coco, concentré de carthame, acidifiant : acide citrique, protéines de pois hydrolysées, arôme naturel. Pourcentages exprimes sur le produit fini.', 'https://static.openfoodfacts.org/images/products/325/622/542/6249/front_fr.6.400.jpg', '5.8', '4.2', '28.7', '24.8', '0', '1.5', '0.1', '0.0393700787401575', '', '1');

