VALUES ('3256225426584', 'Plateau Asiatique 14 Pièces + Sauces', 'Mini-nems au porc (6 x 20g) : Galettes de riz garnies d\'une farce à base de viande de porc. Eau, farine de riz 14%, oignon, gorge de porc (origine : France) 10%, morceau de tête de porc (origine : France) 5%, gras de porc (origine : France) 5%, pousse de haricot mungo, amidons de pois, huile de tournesol, champignon noir, amidon de maïs, sel, fibre de BLÉ, épices, sucre caramélisé, gingembre, poivre, arôme naturel. Soit 63% de garniture. Pourcentage exprimé sur le mini-nem au porc. Acras à la morue (4 x 20 g) : chair de morue 35% [CABILLAUD, sel], oignon, farine de BLÉ, eau, flocon de pomme de terre (pomme de terre, antioxydant : extrait de romarin), huile de tournesol, persil, fécule de manioc, ail, poudres à lever : diphosphate disodique et carbonate acide de sodium, amidon de BLÉ, OEUF, jus de citron, sel, poivre, piment, arôme naturel. Pourcentage exprimé sur l\'acra à la morue. Mini-samoussas au porc (2 x 30 g) : Galettes de blé garnies d\'une farce à la viande de porc. Farine de BLE 22%, eau, gorge de porc (origine : France) 17%], oignon%, morceau de tête de porc (origine : France) 8%, gras de porc (origine : France) 8%, amidon de pois, huile de tournesol, sel, épices, fibre de BLE, sel, amidon de maïs, arômes naturels, poivre, piment. Soit 66% de garniture. Pourcentage exprimé sur le mini-samoussa au porc. Beignets de crevette (2 x 20 g) : Pâte à beignet garnie d\'une queue crevette. Queue de CREVETTES 31.5%, farine de BLE, huile de tournesol, eau, OEUF, blanc d\'OEUF, poudres à lever : diphosphate disodique et carbonate acide de sodium, amidon de BLE, sel, poivre. Pourcentage exprimé sur le beignet de crevette. Sauce aigre-douce 40 g : eau, sucre, vinaigre d\'alcool, amidon transformé, purée de piment (piment, sel, vinaigre d\'alcool), sel. Sauce au nuoc mâm 30 g : eau, sucre, vinaigre d\'alcool, sel, nuoc mâm 1,6% (POISSON, sel, eau), sauce SOJA (eau, graines de SOJA, sel, farine de BLÉ). Pourcentage exprimé sur la sauce au nuoc mâm. Traces éventuelles de lait et d\'arachides.', 'https://static.openfoodfacts.org/images/products/325/622/542/6584/front_fr.31.400.jpg', '11', '2.4', '23', '4.7', '1.8', '5.4', '1.7', '0.669291338582677', '', '0');

