VALUES ('3256225427192', 'Couscous', 'Légumes, émincé de poulet traité en salaison rôti et merguez cuite 73,3% : Légumes 26% (carotte 6,1%, courgette, navet 3,4%, poivron rouge, poivron vert, CELERI, pois chiche 2,1% (pois chiche, eau, sel)), eau, émincé de poulet traité en salaison rôti 9,3% (filet de poulet 8.9% (Pologne), dextrose, amidon de tapioca, sel), merguez cuite 8,3% (viande et gras de bovin 6% (France), eau, viande de mouton (Espagne, France, Irlande, Royaume Uni), sel, dextrose, épices, arômes naturels, colorant : extrait de paprika, antioxydant : érythorbate de sodium. Boyau de mouton), fond de légumes (extraits de légumes, extrait de vin blanc, sel, huile de tournesol, extraits d\'épices), huile d\'olive vierge extra, épices et plantes aromatiques (dont cumin 0,04% et coriandre 0,04%), huile de tournesol, purée de tomate double concentré, amidon de maïs, arôme naturel, sel. Semoule cuisinée 26,7% : semoule de BLE dur 14%, eau, raisin sec 0,4% (raisin sec, agent d\'enrobage : huile de coton), sel, huile de tournesol, curcuma. Traces éventuelles d\'oeuf, de moutarde et de graine de sésame.', 'https://static.openfoodfacts.org/images/products/325/622/542/7192/front_fr.35.400.jpg', '4.5', '1.4', '12', '1.4', '2.3', '6.3', '0.68', '0.267716535433071', '', '1');

